import React from 'react';

import Card from "../common/Card";
import Dropdown from '../common/Dropdown';
import "./dropdown.css";

export default {
  title: 'Common/Dropdown',
  component: Dropdown,
  argTypes: {
    backgroundColor: { control: 'color' },
  },
};

const Template = (args) => <Dropdown {...args} />;

export const SimpleDropdown = Template.bind({});;

export const CardWithHeader = Template.bind({});;

export const CardWithHeaderAndFooter = Template.bind({});

function Header() {
    return <div>HEADER</div>
}

function Footer() {
    return <div>FOOTER</div>
}

function MainContent() {
    return <div style={{height: '100px'}}>
        Main Content
    </div>
}

const options = [{
    label: 'Full Access',
    value: 'full_access'
}, {
    label: 'Can Edit',
    value: 'can_edit'
}, {
    label: 'Can View',
    value: 'can_view'
}, {
    label: 'No Access',
    value: 'no_access'
}]

SimpleDropdown.args = {
    options,
    placeHolder: 'Search Access',
    showCaretIcon: false,
    classes: {
        dropdownContainer: 'dropdown-container-override'
    }
};


CardWithHeader.args = {
    style: {
        // width: '512px',
        marginTop: '10px'
    },
    header: {
        component: <Header />,
    },
    children: <MainContent />
};

CardWithHeaderAndFooter.args = {
    style: {
        // width: '512px',
        marginTop: '10px'
    },
    header: {
        component: <Header />,
    },
    footer: {
        component: <Footer />,
    },
    children: <MainContent />
};


